import HeroBanner from "./components/Banner/HeroBanner";
import Button from "./components/Button/Button";
import bannerImage from './img/airlines.jpg';

const bannerContent = {
  bannerTitle: "Great Things Take time",
  bannerSubTitle: "Focus on what you are doing, until it get done.",
  BannerButton: "Explore Now"
}

function App() {
  return (
    <>
      <HeroBanner className="mainBanner">
        <div className="bannerImage">
          <img src={bannerImage} alt="banner"/>
        </div>
        <div className="container">
          <div className="bannerContent">
            {bannerContent.bannerTitle !== '' ? <h1>{bannerContent.bannerTitle}</h1> : ''}
            {bannerContent.bannerSubTitle !== '' ? <p>{bannerContent.bannerSubTitle}</p> : ''}
            {bannerContent.BannerButton !== '' ? <Button type="button" className="btn-red">{bannerContent.BannerButton}</Button> : ''}
          </div>
        </div>
      </HeroBanner>
    </>
  );
}

export default App;
